<p><hi rend="bold">Wymbritseradeel</hi> atau <hi rend="italic">Wymbritseradiel</hi> (<ref target="https://id.wikipedia.org/wiki/Bahasa_Frisia">bahasa Frisia</ref>), adalah sebuah bekas <hi rend="italic"><ref target="https://id.wikipedia.org/wiki/Gemeente">gemeente</ref></hi> <ref target="https://id.wikipedia.org/wiki/Belanda">Belanda</ref> yang terletak di <ref target="https://id.wikipedia.org/wiki/Provinsi">provinsi</ref> <ref target="https://id.wikipedia.org/wiki/Friesland">Friesland</ref>. Pada tahun <ref target="https://id.wikipedia.org/wiki/2004">2004</ref> daerah ini memiliki <ref target="https://id.wikipedia.org/wiki/Penduduk">penduduk</ref> sebesar 16.312 jiwa.</p>
